import styles from "../styles/index.module.scss";
import React from "react";

const Index = () => {
  return (
    <div className={styles.main_background}>
      <h1>Diario</h1>
        <span>
            Handy collection of tools to help you through life
        </span>
    </div>
  );
};
export default Index;
